import Slider from "react-slick";
import 'bootstrap/dist/css/bootstrap.css';
import React from "react";
import "./index.css";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import help from '../../assets/carousel/help.jpg';

export default function SimpleSlider() {
  var settings = {
  dots: true,
  infinite: false,
  speed: 300,
  slidesToShow: 4,
  slidesToScroll: 4,
  responsive: [
    {
      breakpoint: 1024,
      settings: {
        slidesToShow: 3,
        slidesToScroll: 3,
        infinite: true,
        dots: true
      }
    },
    {
      breakpoint: 600,
      settings: {
        slidesToShow: 2,
        slidesToScroll: 2
      }
    },
    {
      breakpoint: 480,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1
      }
    }
    // You can unslick at a given breakpoint now by adding:
    // settings: "unslick"
    // instead of a settings object
  ]
  };
  return (
    <Slider {...settings}>
      <div>
        <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
      <div>
      <img src={help} />
      </div>
    </Slider>
  );
}
